import { Container, Grid} from '@material-ui/core'
import React, { useEffect, useState } from 'react'
import  Cards  from './Cards'

const Home = () => {
    const [Notes, setNotes] = useState([])

    useEffect(() => {
        fetch("http://localhost:8000/notes")
            .then(res => res.json())
            .then(data => setNotes(data))
    }, [])

