//}

    return (

        <Container>
            <div container spacing={2} >
                {Notes.map(note => (
                    <Grid item  key={note.id} xs={12} md={6} lg={4}  >
                        <Cards note={note} /> 
                        </Grid>
                ))}
            </div>
        </Container>
    )


}

export default Home
